import React from "react";
import { Link } from "react-router-dom";

const RecipeRec = ({ recipeRec }) => {
  if (recipeRec.hits) {
    return (
      <div className="recipe-rec">
        <p>RecipeRec</p>
        <p>{recipeRec.hits[0].recipe.label}</p>
        <img src={recipeRec.hits[0].recipe.image} alt="first recipe" key="0"/>
        <Link to="/">Back to Home.</Link>
      </div>
    );
  } else {
    return (
      <div className="recipe-rec">
        <p>Nothing yet.</p>
        <Link to="/">Back to Home.</Link>
      </div>
    );
  }
};

export default RecipeRec;
